import styled from 'styled-components';
import logo from '../../assets/background.jpg';

export const Landscape = styled.div`
  min-width: 100%;
  min-height: 100%;
  background-image: url(${logo});
  background-repeat: no-repeat;
  background-size: cover;
`;
